import logo from './logo.svg';
import './App.css';
import axios from "axios";

const getVehicles = async () => {
  const res = await axios("/vehicles");
  return res.json();
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        sss
        {getVehicles()}
      </header>
    </div>
  );
}

export default App;
